CREATE TABLE account_activity (
    location_id character varying(255) NOT NULL,
    activity character varying(255) NOT NULL,
    daily character varying(255),
    weekly character varying(255),
    monthly character varying(255),
    yearly character varying(255),
    year_to_date character varying(255)
);

CREATE TABLE app_users (
    user_id character varying(255) NOT NULL,
    password character varying(255) NOT NULL,
    email_address character varying(255),
    phone_number character varying(255),
    creation_date timestamp without time zone,
    last_login_date timestamp without time zone,
    status character varying(255)
);

CREATE TABLE atms (
    atm_id character varying(255) NOT NULL,
    location_id character varying(255),
    status character varying(255),
    switch_status character varying(255),
    hardware_status character varying(255),
    cash_status character varying(255),
    card_reader_status character varying(255),
    receipt_print_status character varying(255),
    camera_status character varying(255),
    cash_position character varying(255),
    gl_position character varying(255),
    latitude character varying(255),
    longitude character varying(255),
    last_transaction_time character varying(255)
);

CREATE TABLE location_accounts (
    location_id character varying(255) NOT NULL,
    account_no character varying(255) NOT NULL,
    title character varying(255),
    balance character varying(255) NOT NULL
);

CREATE TABLE location_images (
    id integer NOT NULL,
    created_at timestamp without time zone DEFAULT now() NOT NULL,
    location_id character varying(255),
    image_category_id character varying(255),
    image_path character varying(255)
);

CREATE TABLE location_rating (
    location_id character varying(255) NOT NULL,
    daily character varying(255),
    weekly character varying(255),
    monthly character varying(255),
    yearly character varying(255),
    year_to_date character varying(255)
);

CREATE TABLE location_relations (
    location_id character varying(255) NOT NULL,
    relation character varying(255) NOT NULL,
    description character varying(255),
    balance character varying(255)
);

CREATE TABLE location_types (
    location_type_id character varying(255) NOT NULL,
    description character varying(255)
);

CREATE TABLE public.locations (
    location_id character varying(255) NOT NULL,
    location_description character varying(255),
    address character varying(255),
    contact_no character varying(255),
    latitude character varying(255),
    longitude character varying(255),
    location_type character varying(255),
    created_at timestamp without time zone,
    finance_type character varying(255),
    location_code character varying(255),
    accounts_active character varying(255),
    accounts_closed character varying(255),
    accounts_dormant character varying(255),
    accounts_high_risk character varying(255),
    accounts_medium_risk character varying(255),
    accounts_low_risk character varying(255),
    audit_category character varying(255),
    h_id character varying(255)
);

CREATE TABLE transaction_activity (
    location_id character varying(255) NOT NULL,
    activity character varying(255) NOT NULL,
    daily character varying(255),
    weekly character varying(255),
    monthly character varying(255),
    yearly character varying(255),
    year_to_date character varying(255)
);

CREATE TABLE user_categories (
    category_id character varying(255) NOT NULL,
    description character varying(255) NOT NULL
);

CREATE TABLE user_loc_mapping (
    user_id character varying(255) NOT NULL,
    location_id character varying(255) NOT NULL,
    category_id character varying(255) NOT NULL
);

CREATE TABLE user_locations (
    user_id character varying(255) NOT NULL,
    location_id character varying(255) DEFAULT now() NOT NULL,
    category_id character varying(255) NOT NULL
);



